import React from "react";
import styles from "./Result.module.css";
import Printer from "../../../assets/Printer.png";
import Flags from "../../../assets/Flags.png";
import BackgroundImage from "../../../assets/background.png";
import snsBtn from "../../../assets/SNSBtn.png";
import search from "../../../assets/Search.png";

const DUMMY_DATA = [
  {
    id: "1",
    title: "당신의 개발자 성향은?\n프론트엔드(Front-End)",
    titleContent:
      "눈에 보이는 화면을 개발하는 프론트엔드. 디자이너, PM, 백엔드 사이에서 구체적인 요구사항을 표현합니다. 보다 나은 사용자 경험(UX)를 위해 개발합니다.",
    printer: Printer,
    flags: Flags,
  },
];

const Result = () => {
  return (
    <div className={styles.container}>
      <div
        className={styles.backGroundImg}
        style={{ backgroundImage: `url(${BackgroundImage})` }}
      />
      <header className={styles.topTitle}>
        <section className={styles.MaintitleBox}>
          {DUMMY_DATA.map((data) => (
            <h5
              className={styles.MainTitleContent}
              style={{ whiteSpace: "pre-line" }}
            >
              {data.title}
            </h5>
          ))}
          <img
            src={search}
            alt="검색이미지입니다."
            className={styles.titleSearch}
          />
        </section>
        <section className={styles.titleContentBox}>
          {DUMMY_DATA.map((data) => (
            <div className={styles.titleContent}>{data.titleContent}</div>
          ))}
        </section>
      </header>
      <main className={styles.contentBox}>
        {/* {DUMMY_DATA.map((data) => (
          <img src={data.printer} alt={data.title} />
        ))}
        <div className={styles.etcBox}>
          {DUMMY_DATA.map((data) => (
            <img src={data.flags} alt={data.title} />
          ))}
        </div> */}
        <img src={snsBtn} alt="공유 이미지입니다." className={styles.sns} />
      </main>
    </div>
  );
};

export default Result;
